import React, { Component } from "react";

import Greeting from "./Greeting/Greeting";
import SearchBar from "./SearchBar/SearchBar";
import WatchList from "./WatchList/WatchList";
import LoginHeader from "./LoginHeader/LoginHeader";
import Info from "../HomePage/def/users.json";

const doc = Info.doctors[0];
const patients = doc.watchlist;
class DoctorDashBoard extends Component {
  constructor(props) {
    //
    super(props);
    this.props.history.push("/DoctorHome"); //
  }
  state = {
    message: { type: "", body: "" },
  };
  render() {
    const { history, app } = this.props;
    return (
      <div className="doctor_dashboard_background">
        <LoginHeader history={history} app={app} name="yyy" />
        <Greeting name="yyy" userId="123" />
        <SearchBar users={patients} />
        <WatchList patients={patients} />
      </div>
    );
  }
}

export default DoctorDashBoard;
